CREATE TABLE `products` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `slug` varchar(255) DEFAULT NULL,
  `uuid` char(36) NOT NULL,
  `shop_id` bigint unsigned NOT NULL,
  `category_id` bigint unsigned DEFAULT NULL,
  `brand_id` bigint unsigned DEFAULT NULL,
  `unit_id` bigint unsigned DEFAULT NULL,
  `keywords` varchar(191) DEFAULT NULL,
  `img` varchar(255) DEFAULT NULL,
  `qr_code` varchar(255) DEFAULT NULL,
  `tax` double DEFAULT NULL,
  `active` tinyint(1) NOT NULL DEFAULT '0',
  `status` enum('published','pending','unpublished') NOT NULL DEFAULT 'pending',
  `min_qty` int NOT NULL DEFAULT '1',
  `max_qty` int NOT NULL DEFAULT '1000000',
  `addon` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `vegetarian` tinyint(1) NOT NULL DEFAULT '0',
  `kcal` varchar(10) DEFAULT '0',
  `carbs` varchar(10) DEFAULT '0',
  `protein` varchar(10) DEFAULT '0',
  `fats` varchar(10) DEFAULT '0',
  `interval` double NOT NULL DEFAULT '1',
  `status_note` varchar(255) DEFAULT NULL,
  `kitchen_id` bigint unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `products_shop_id_foreign` (`shop_id`),
  KEY `products_category_id_foreign` (`category_id`),
  KEY `products_brand_id_foreign` (`brand_id`),
  KEY `products_unit_id_foreign` (`unit_id`),
  KEY `products_uuid_index` (`uuid`)
) ENGINE=InnoDB AUTO_INCREMENT=227 DEFAULT CHARSET=utf8mb3;

